import React from "react";
import { Link } from "react-router-dom";

import "./slider.styles.css";

export default function ItemSlider(props) {
  const { slide, index } = props;
  return (
    <>
      <div className="content-slide">
        <div className="left">
          <h1>Slide 1: Lorem ipsum dolor sit amet</h1>
          <p>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Corporis,
            veritatis et quasi ipsum quia repellendus dolorem provident, labore
            totam libero consequatur? Vero aut illum tempora, voluptatibus
            commodi perferendis quidem sit! lorem ipsum dolor, sit amet
            consectetur adipisicing elit. Quod, eveniet tempore nesciunt facilis
            inventore beatae quam fugit ducimus, voluptatibus enim aliquid
            necessitatibus officia perferendis dolor nulla adipisci corporis ad
            obcaecati?
          </p>

          <Link to="">Más Información</Link>
        </div>
        <div className="right">
          <img src={slide} alt="" />
        </div>
      </div>
    </>
  );
}
